import React,{useState,useEffect,Fragment} from 'react';
import Movie from '../Movie/Movie';
import './Movies.css';
import '../Movie/Movie.css';
const Movies = ({videos}) =>{
  return(
    <Fragment>
      <ul className = 'movies'>
        {
          videos.map( video => <li className = 'classLi'><a href = '' onMouseEnter = {(event) =>
            {
              let icons = event.currentTarget.lastElementChild.lastElementChild;
              console.log(icons);
              icons.addEventListener('onMouseEnter',() => icons.classList.toggle('show'))
            }
          }><Movie video = {video.video_url} title = {video.name} description = {video.description}/></a></li>)
        }
      </ul>
    </Fragment>
  )
}
export default Movies;
